import React from 'react';
import { ReactComponent as CheckedIcon } from '../icons/check-on.svg';
import { ReactComponent as UncheckedIcon } from '../icons/check-off.svg';
import S from './style';

const CheckboxWithLabel = ({ checked = false, onClick, label = "텍스트" }) => {
    return (
        <S.CheckboxWithLabelWrapper onClick={onClick}>
            <S.IconWrapper>
                {checked ? (
                    <CheckedIcon width={24} height={24} />
                ) : (
                    <UncheckedIcon width={24} height={24} />
                )}
            </S.IconWrapper>
            <S.Label>{label}</S.Label>
        </S.CheckboxWithLabelWrapper>
    );
};

export default CheckboxWithLabel;
